INSERT INTO `tl_article` (`id`, `pid`, `sorting`, `tstamp`, `title`, `alias`, `author`, `inColumn`, `keywords`, `showTeaser`, `teaserCssID`, `teaser`, `printable`, `customTpl`, `protected`, `groups`, `guests`, `cssID`, `space`, `published`, `start`, `stop`) VALUES ( 64, 63, 128, 1505648181, 'I am my Facebook and it is me', 'i-am-my-facebook-and-it-is-me', 4, 'main', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '<p>Facebook is used on a massive scale everyday. Creating terrabytes of internet traffic and filling enormous databases with all your personal details. What are the effects of this massive social experiment and what is Facebook really doing with our data?[nbsp]</p>\n<p>[nbsp]</p>\n<p><img src="{{file::d10b1120-9a1e-11e7-a1b2-7017236cb443}}" alt="" width="960" height="684"></p>', '', 'mod_article_bootstrap_container', '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '1', '', '' );
