ld on the platform.</p>\n<p>It’s been a crazy ten days for bitcoin enthusiasts as the network had its first high profile hard fork that split the network into two. During the first week, the Bitcoin Cash blockchain has pushed forward, and the currency’s market is thriving. Now two cryptocurrency payment processors, the Living Room of Satoshi, and Rocketr have announced supporting BCH on their platforms.</p>', '1', 0x24e1e54c7d9311e7b1baec9b4278947f, '', '', 'a:3:{i:0;s:3:"100";i:1;s:3:"100";i:2;s:3:"box";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
