when Facebook was becoming popular. The generation before me did not use Facebook and people only really began to use it around the ages of 14 to 15. Nowadays it seems children as young as 7 - 8 have Facebook. The amount of children with mobile phones is always increasing and with it the amount of Facebook Mobile users.[nbsp]</p>\n<p>[nbsp]</p>\n<p>[nbsp]</p>', '', 0x5d969a9e97db11e7868e0cc47adc87ce, '', '', 'a:3:{i:0;s:3:"100";i:1;s:3:"100";i:2;s:3:"box";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
