think the government has access to your information through Facebook?[nbsp]</li>\n<li>[nbsp]How do you feel about computers analysing your personal information to give you suitable adverts?[</li>\n</ul>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, 'bwa-GtWp4h4', NULL, 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
