, and we should be able to say what we believe. I channel my inspiration from all my travels and crazy activities into giving fun and exciting English lessons.</p>', '', 0xf5a6132093c711e796b9018ec739c73b, '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:8:"col-md-6";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '1', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
