lower prices and fairly low delivery times. How do they do this?[nbsp]<span style="text-decoration: underline;">Offshore tax evasion</span>[nbsp]and highly organised mass production style distribution centres. Workers in these centers often complain of low[nbsp]<span style="text-decoration: underline;">wages,</span>[nbsp]limited toilet breaks and harsh working conditions. Amazon has recently began to expand its[nbsp]<span style="text-decoration: underline;">presence</span>[nbsp]and many post offices and university campuses now have Amazon delivery stations</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 0, '', 10, '', '', '', '', '', NULL, 0, 0, '' );
